import BooksList from './BooksList'; // Importuojame naują komponentą
import { NavBar } from './Navbar';

function App() {
    return (
        <>
        <Router>
            <NavBar />
            <Routes>
                <Route path="/other" element={<OtherPage />} />
            </Routes>
        </Router>
        <div className="App">
            <header className="App-header">
                <h1>Sveiki atvykę į biblioteką!</h1>
                {/*<BooksList /> {/* Priedame knygų sąrašą }*/}
            </header>
        </div>
        </>
    );
}

export default App;
